  constructor(props) {
    super(props);
    this.state = { apiResponse: "" };
  }

  callAPI() {
      fetch("http://104.128.95.54:9000/testAPI")
          .then(res => res.text())
          .then(res => this.setState({ apiResponse: res }))
          .then(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }


  render(){
    return <Redirect to='/Home' />
  }
}

export default App;
